import './App.css';
import Top from "./myComponent/Top";
import BlankTextImage from "./myComponent/BlankTextImage";
import logo from "./img/artificial-intelligence.png"
import rocketBlankTextImage from "./img/rocket.png"
import playIcon from "./img/playIcon.png"
import UlFlex from "./myComponent/UlFlex";
import logoUl1 from "./img/logoUl1.png";
import brain from "./img/brain.png";
import smartphone from "./img/smartphone.png";
import logoUl2 from "./img/logoUl2.png"
import logoUl3 from "./img/logoUl3.png"
import logoUl4 from "./img/logoUl4.png"
let logoUl = [
    logoUl1,
    logoUl2,
    logoUl3,
    logoUl4
]
function App() {
  return (
    <div className="App">
        <Top img={logo} />
        <BlankTextImage
            img={rocketBlankTextImage}
            iconButton={playIcon}
            reverse={false}
            topText={"Next genaretion platform"}
            h1Text={"Artificial intelligence & Syber security"}
            mainText={"Lorem ipsum is placeholder text commonly " +
                "used in the graphic, print, and publishing " +
                "industries for previewing layouts and visual mockups."}
            button={2}
            button1={"Get Started"}
            button2={"Watch Video"}



        />
        <UlFlex count={4} img={logoUl} />
        <BlankTextImage
            img={brain}
            imgButton={false}
            reverse={true}
            h1Text={"Apply AI, Deep Learning and Data Sciece to solve"}
            mainText={"Lorem ipsum is placeholder text commonly used" +
                " in the graphic, print, and publishing industries" +
                " for previewing layouts and visual mockups."}
            button={1}
            button1={"Learn More"}
        />
        <UlFlex count={5} img={logoUl} />
        <BlankTextImage
            img={smartphone}
            imgButton={false}
            reverse={false}
            h1Text={"What our clients say about our awesome solutions"}
            mainText={"To take a trivial example, which of us ever" +
                " undertakes laborious physical exercise, except to" +
                " obtain some advantage from it who do not know." +
                "Lorem ipsum is placeholder text commonly used in" +
                " the graphic, print, and publishing ." +
                "Lorem ipsum is placeholder previewing layouts and" +
                " visual mockups. Lorem ipsum is placeholder text" +
                " commonly used in the graphic, print, and publishing" +
                " industries for previewing layouts and visual mockups."}
            button={0}
        />
    </div>
  );
}

export default App;
